import React from 'react';

function ExpIntro() {
  return (
    <aside className="experience-intro">
      <div className="intro-left-box">
        <p className="intro-left-para">Je maîtrise :</p>
        <ul className="intro-left-list">
          <li className="intro-left-item">La communication active</li>
          <li className="intro-left-item">La résolution de problèmes</li>
          <li className="intro-left-item">Le travail en équipe</li>
        </ul>
      </div>
      <div className="intro-right-box">
        <div className="vertical-bar" />
        <p className="intro-right-para">
          Grâce à mes expériences dans le  Tourisme
          {' '}
          <br />
          {' '}
          et le Luxe, je maîtrise la résolution de problèmes.
        </p>
      </div>
    </aside>
  );
}

export default ExpIntro;
